
public class Page175 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 75;
		if (a > 50) {
			if (a < 100) {
				System.out.println(a + "는 50보다 크고 100보다 작네 \n");
			} else {
				System.out.println(a  + "는 100보다 크구만 \n");
			}
	} else {
			System.out.println(a + " 50보다 작구만 \n");
		}
	}
}
